import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';
import { Home } from './pages/home';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Routes>
        <Route path='/' co/>
        <Route/>
      <Home/>
      </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
